import React from 'react';
import './card-styles.css';

export const Card = props => (
    <div className='card-container'>
        {console.log(props.key)}
        <img alt='monster' src={`https://robohash.org/${props.key}?set=set2&size=180x180`} />
        <h1>{props.monster}</h1>
    </div>
);
